import React, { useState, useEffect, useMemo } from "react";
import "./FoodQR.css";
import { Link } from "react-router-dom";

function NavbarBG() {
  return <div id="navbarbg"></div>;
}

function NavbarItems2() {
  return (
    <div id="NI2">
      <h1 id="hr">HOSTEL RESIDENT</h1>
      <a href="#" id="h">
        Home
      </a>
      <Link to="/" id="mealselect">
        Meal Selection
      </Link>
      <a href="#" id="com">
        Complaints
      </a>
      <a href="#" id="pro">
        Profile
      </a>
      <a href="#" id="log">
        Logout
      </a>
    </div>
  );
}

function FoodQRHeading() {
  return <h1 id="FoodQRGrad">Food QR</h1>;
}

function WeekButtonsQR({ setDay, disabledDays }) {
  const days = [
    "Monday",
    "Tuesday",
    "Wednesday",
    "Thursday",
    "Friday",
    "Saturday",
    "Sunday",
  ];

  return (
    <div id="weekbtns">
      {days.map((day) => (
        <button
          key={day}
          id={day.toLowerCase().slice(0, 3)}
          onClick={() => setDay(day)}
        >
          {day}
        </button>
      ))}
    </div>
  );
}

function QRDownload() {
  return (
    <div id="QRDownBG">
      <span id="ActualQR"></span>
      <button id="QRDownbtn">Download</button>
    </div>
  );
}

function FoodQR() {
  return (
    <div id="container">
      <NavbarBG />
      <NavbarItems2 />
      <FoodQRHeading />
      <WeekButtonsQR />
      <QRDownload />
    </div>
  );
}
export default FoodQR;
